import './App.css';
import { BrowserRouter, Route,Routes } from 'react-router-dom';
import AppContent from './AppContent';
import Mainpage from './components/Start';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
    <Mainpage/>
    <Routes>
    <Route path='/s'  element={  <AppContent />}/>
    </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
